import React from 'react';

import Header from './components/Header';
import Footer from './components/Footer';
import RecomendedCard from './components/RecomendedCards';
import MainContent from './components/MainContent';
function App() {
  return (
    <React.Fragment>
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
            <a className="navbar-brand" href="/#">Жалобы и отзывы</a>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="/#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>

            <div className="collapse navbar-collapse" id="navbarSupportedContent">
                <ul className="navbar-nav mr-auto">
                <li className="nav-item active">
                    <a className="nav-link" href="/#">Жалобы</a>
                </li>
                <li className="nav-item">
                    <a className="nav-link" href="/#">Рекомендации</a>
                </li>
                <li className="nav-item">
                    <a className="nav-link" href="/#">Информация</a>
                </li>
                </ul>
                <form className="form-inline my-2 my-lg-0">
                    <input className="form-control mr-sm-2" type="search" placeholder="Поиск" aria-label="Поиск" />
                    <button className="btn btn-outline-primary my-2 my-sm-0" type="submit">Найти</button>
                </form>
            </div>
        </nav>
      {/* <Header /> */}
      {/* <div className="container-fluid pt-5">
        <div className="row">
          <MainContent />
          <RecomendedCard />
        </div>
      </div> */}
      <Footer />
    </React.Fragment>
  );
}

export default App;
